import img_nic from '../images/n.jpg';

import CardComponent from "./CardComponent";

export default function TeamComponent() {

    const nic = <CardComponent name="Nazlı" lastname="İkizler Cinbiş" img={img_nic} job="Supervisor"/>;
    const eke = <CardComponent name="Erdem Korhan" lastname="Erdem" img={img_hcy} job="Software Developer"/>;
    const ahg = <CardComponent name="Ahmet Hidayet" lastname="Gürbüz" img={img_hcy} job="Software Developer"/>;
    const hcy = <CardComponent name="Hüseyin Can" lastname="Yılmaz" img={img_hcy} job="Software Developer"/>;

    return (
        <div className="team-component">

            <div className='my-header'>Team</div>
            <>
            <div className="team-inst">{nic}</div>
            <div className="team-studs">
                {eke}
                {ahg}
                {hcy}
            </div>
            </>  
        </div>
    );
}
